import React from "react";
import { render } from "react-dom";

var element = ['element1','element2','element3','element4']
function list (){
    return(
        <div>
            {
                element.map(function(element,index){
                    return <li key={index}>{element}</li>
                })
            }
        </div>

    )
}
export default list;
